        type=''plain''>bit.ly - Click to Subscribe! Mr. Popper''s Penguins hits theaters
        on June 17th, 2011. Cast: Jim Carrey, Carla Gugino, Ophelia Lovibond, Philip
        Baker Hall, James Tupper, Clark Gregg, Angela Lansbury In this family comedy,
        Jim Carrey is Mr. Popper, a driven businessman who is clueless when it comes
        to the important things in life - until he inherits six penguins. Popper''s
        penguins turn his swank New York apartment into a snowy winter wonderland
        - and the rest of his life upside-down. Filmed on a refrigerated soundstage
        with real Emperor Penguins, "Mr. Popper''s Penguins" is a contemporary adaptation
        of the classic book. Mr. Popper''s Penguins trailer courtesy 20th Century
        Fox.</media:description><media:keywords>Mr. Popper''s Penguins, movie trailer,
