        scheme=''urn:youtube'' yt:display=''TsavenNava''>tsavennava</media:credit><media:description
        type=''plain''>This has got to be one very, very relieved penguin! Just to
        be clear, I DID NOT TAKE THIS VIDEO, and nor did I add the (annoying) music.
        This video was given to me by the chef at Vernadsky, the Ukrainian research
        station about 90 miles south of where I''m currently living (Palmer Station,
        Antarctica). And even then, I don''t think he took the video himself, either.
        I honestly don''t know it''s original source. If you want to follow my experiences
        of working down here on the highest, driest, coldest, harshest continent,
        check out my blog; frozennerd.blogspot.com</media:description><media:keywords>Antarctica,
